// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract brdsContract {
    struct LogEntry {
        string cid;
        address sender;
        uint256 timestamp;
    }

    // List of all logs
    LogEntry[] private logs;

    // Mapping from sender to their list of log indices
    mapping(address => uint256[]) private senderToLogs;

    // Event emitted when a new log is added
    event LogAdded(address indexed sender, string cid, uint256 timestamp);

    // Add a new log (CID)
    function addLog(string memory _cid) external {
        LogEntry memory newLog = LogEntry({
            cid: _cid,
            sender: msg.sender,
            timestamp: block.timestamp
        });

        logs.push(newLog);
        senderToLogs[msg.sender].push(logs.length - 1);

        emit LogAdded(msg.sender, _cid, block.timestamp);
    }

    // Get all logs
    function getAllLogs() external view returns (LogEntry[] memory) {
        return logs;
    }

    // Get logs submitted by a specific address
    function getLogsByAddress(address _sender) external view returns (LogEntry[] memory) {
        uint256[] memory indices = senderToLogs[_sender];
        LogEntry[] memory result = new LogEntry[](indices.length);

        for (uint256 i = 0; i < indices.length; i++) {
            result[i] = logs[indices[i]];
        }

        return result;
    }

    // Get total number of logs
    function getLogsCount() external view returns (uint256) {
        return logs.length;
    }
}
